  study done of Martin National Wildlife Refuge pursuant to the Wilderness Act of
  1964. It provides information as to the history of the refuge, its location, resources
  it provides, public usage, and future developments. It concludes that it is not
  suitable for wilderness designation as the refuge requires human intervention to
  maintain its state.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
